import "./Home.css";
import Logo from "../Logo/Logo";
import MenuTopRight from "../Menu top-right/MenuTopRight";
import pancake from "../../Images/pancake.jpeg";

function Home() {
  return (
      <>
      <section>
        <Logo />
        <h1 className="menu-heading">Menu</h1>
      </section>
      <section style={{margin:"2.5rem, 2.5rem"}}>
        <img className="pancake" src={pancake} />
        <MenuTopRight />
      </section>
      <section style={{backgroundColor: "green", margin:"2.5rem"}}>
        <Logo />
        <h1 className="menu-heading">Menu</h1>

      </section>
      </>
  );
}

export default Home;
